ZZ_pEXY GetBivariateResultant()
{

    FpEX_elem f1,f2,f3,f4,f5,f6,f7,f8,f9;
    NTL::SetCoeff(f1, 16, Fp_elem(1));

    NTL::SetCoeff(f2, 8, Fp_elem(-16));
    NTL::SetCoeff(f2, 0, Fp_elem(-1));

    NTL::SetCoeff(f3, 8, Fp_elem(-352));
    NTL::SetCoeff(f3, 0, Fp_elem(-22));

    NTL::SetCoeff(f4, 8, Fp_elem(-3328));
    NTL::SetCoeff(f4, 0, Fp_elem(-208));

    NTL::SetCoeff(f5, 8, Fp_elem(-17664));
    NTL::SetCoeff(f5, 0, Fp_elem(-1104));

    NTL::SetCoeff(f6, 8, Fp_elem(-57344));
    NTL::SetCoeff(f6, 0, Fp_elem(-3584));

    NTL::SetCoeff(f7, 8, Fp_elem(-114688));
    NTL::SetCoeff(f7, 0, Fp_elem(-7168));

    NTL::SetCoeff(f8, 8, Fp_elem(-131072));
    NTL::SetCoeff(f8, 0, Fp_elem(-8192));

    NTL::SetCoeff(f9, 8, Fp_elem(-65536));
    NTL::SetCoeff(f9, 0, Fp_elem(-4096));

    NTL::Vec<FpEX_elem> cs;
    cs.SetLength(9);
    cs[8] = f1;
    cs[7] = f2;
    cs[6] = f3;
    cs[5] = f4;
    cs[4] = f5;
    cs[3] = f6;
    cs[2] = f7;
    cs[1] = f8;
    cs[0] = f9;

    return ZZ_pEXY(cs);
};

